	vector<double>estimated_wheelSize;
	vector<double>estimated_payouts;
	vector<vector<vector<int>>>alp_cnt;
	vector<vector<int>>alp_cnt_sum;
	vector<int>notePlayCnt;
	vector<vector<vector<Edge>>>edges;

	int first_coins, current_coins;
	int first_maxTime, remainTime;
	int noteTime;
	int numMachines;

	bool quick = false;

	void init() {
		estimated_wheelSize.resize(numMachines, 20);
		estimated_payouts.resize(numMachines, 1e7);
		alp_cnt.resize(numMachines, vector<vector<int>>(3, vector<int>(7)));
		alp_cnt_sum.resize(numMachines, vector<int>(3));
		notePlayCnt.resize(numMachines);
		edges.resize(numMachines, vector<vector<Edge>>(3));
	}

	int playSlots(int coins, int maxTime, int noteT, int numM) {
		current_coins = first_coins = coins;
		remainTime = first_maxTime = maxTime;
		noteTime = noteT;
		numMachines = numM;

		init();

		vector<pair<double, int>>eval(numMachines);
		for (int i = 0; i < numMachines; i++)eval[i] = make_pair(1e7, i);

		while (1) {
			if (current_coins == 0)break;
			if (remainTime == 0)break;

			sort(eval.begin(), eval.end());
			reverse(eval.begin(), eval.end());


			if (eval[0].first < 1.)break;
			int id = eval[0].second;

			double scale = 2.7 - 0.6*((estimated_wheelSize[id] - 10) / 20);

			int border = estimated_wheelSize[id] * scale;

			if (quick == false && notePlayCnt[id] > border) quick = true;

			vector<string>ret;
			string order;
			int win;
			if (quick) {
				int unit = min(current_coins, remainTime);

				win = ps.quickPlay(id, unit);

				remainTime -= unit;

				current_coins = current_coins - unit + win;
			}
			else {
				if (remainTime < noteTime)break;

				ret = ps.notePlay(id, 1);
				win = stoi(ret[0]);
				order = ret[1];

				count_alp(id, order);
				calc_payouts(id);

				notePlayCnt[id]++;

				eval[0].first = estimated_payouts[id] * (1. + pow(1. * (border - notePlayCnt[id]) / border, 2.));

				double eva = estimated_payouts[id] / (1. + pow(1. * (border - notePlayCnt[id]) / border, 4.5));
				bool flag = 1.2 < eva && eva > eval[1].first;


				if (flag) {
					quick = true;

					for (int i = 0; i < numMachines; i++) {
						int j = eval[i].second;

						eval[i].first = estimated_payouts[j];

						notePlayCnt[j] = estimated_wheelSize[j] * 3 + 1;
					}
				}

				remainTime -= noteTime;

				current_coins = current_coins - 1 + win;
			}

			//cerr << " " << id << " " << estimated_payouts[id] << " " << eval[0].first << endl;
		}

		return 0;
	}

	void count_alp(int id, string order) {
		for (int j = 0; j < 3; j++) {
			int a, b, c;
			a = order[j] - 'A';
			b = order[3 + j] - 'A';
			c = order[6 + j] - 'A';

			int flag = 1;
			for (int s = 0; flag && s < (int)edges[id][j].size(); s++) {
				Edge e = edges[id][j][s];
				if (a == e.from && b == e.to) {
					if (e.next == -1)flag = 2;
					if (c == e.next)flag = 0;
				}
				if (b == e.from && c == e.to) {
					if (e.prev == -1)flag = 2;
					if (a == e.prev)flag = 0;
				}
			}

			if (flag == 1) {
				edges[id][j].push_back(Edge(a, b, -1, c));
				edges[id][j].push_back(Edge(b, c, a, -1));
			}
			else if (flag == 2) {
				flag = 0;
				for (int s = 0; s < (int)edges[id][j].size(); s++) {
					Edge* e = &edges[id][j][s];
					if ((flag & 1) == 0 && a == e->from && b == e->to && e->next == -1) {
						e->next = c;
						flag |= 1;
					}
					if ((flag & 2) == 0 && b == e->from && c == e->to && e->prev == -1) {
						e->prev = a;
						flag |= 2;
					}
				}

				if ((flag & 1) == 0) {
					edges[id][j].push_back(Edge(a, b, -1, c));
				}
				if ((flag & 2) == 0) {
					edges[id][j].push_back(Edge(b, c, a, -1));
				}
			}

			vector<vector<int>>alp_cnt2(7, vector<int>(2));
			for (int s = 0; s < (int)edges[id][j].size(); s++) {
				Edge e = edges[id][j][s];
				alp_cnt2[e.from][0]++;
				alp_cnt2[e.to][1]++;
			}
			alp_cnt_sum[id][j] = 0;
			for (int k = 0; k < 7; k++) {
				alp_cnt[id][j][k] = max<int>(alp_cnt2[k][0], alp_cnt2[k][1]);
				alp_cnt_sum[id][j] += alp_cnt[id][j][k];
			}
		}
	}

	void calc_payouts(int id) {
		vector<int>est2(31);
		int est2_cnt = 0;
		double wheel = 0;

		for (int k = 10; k <= 30; k++) {
			est2[k] = wheelSize_distribution[notePlayCnt[id] + (alp_cnt_sum[id][0] > 30)][alp_cnt_sum[id][0] % 31][k] + wheelSize_distribution[notePlayCnt[id] + (alp_cnt_sum[id][1] > 30)][alp_cnt_sum[id][1] % 31][k] + wheelSize_distribution[notePlayCnt[id] + (alp_cnt_sum[id][2] > 30)][alp_cnt_sum[id][2] % 31][k];
			est2_cnt += est2[k];
			wheel += est2[k] * k;
		}
		wheel /= est2_cnt;
		estimated_wheelSize[id] = wheel;

		double payouts = 0;
		for (int k = 10; k <= 30; k++) {
			for (int j = 0; j < 7; j++) {
				double estimated_alp_cnt[3];
				for (int i = 0; i < 3; i++)estimated_alp_cnt[i] = (alp_cnt[id][i][j] + (k - alp_cnt_sum[id][i]) * ALP_CNT[j] / 38.) / k;
				double prob = estimated_alp_cnt[0] * estimated_alp_cnt[1] * estimated_alp_cnt[2];
				payouts += prob * (current_coins >= 0.75 * PAY[j] ? PAY[j]:PAY[j]*0.5) * (1.*est2[k]/est2_cnt);
			}
		}
		estimated_payouts[id] = payouts;
	}
